css:
.diff-view {
  padding: 5px;
  overflow-y: scroll;
  min-height: 100px;
}
.diff-view div.diff-header {
  height: 20px;
}
.diff-view div.close-diff-view {
  width: 16px;
  height: 16px;
  background: url("atom://diff/assets/images/close.png") no-repeat 0px 0px;
}
.diff-view div.close-diff-view:hover {
  background-position: 0px -26px;
}
.diff-view div.line {
  color: #fff;
  letter-spacing: 0.2em;
}
.diff-view div.red {
  background-color: red;
}
.diff-view div.green {
  background-color: green;
}
